import React from 'react'
import { useNavigate } from 'react-router-dom'

export default function Navbar (props) {
    const navigate = useNavigate()

    return (
        <div className='con'>
            <div className='row'>
                <button onClick={() => { navigate('/about') }} className='landingButton'>About me</button>
                <button onClick={() => { navigate('/resume') }} className='landingButton'>Projects</button>
                <button onClick={() => { navigate('/resume') }} className='landingButton'>Resume</button>
            </div>
        </div>
    )
}
